  {
    No: 13,
    title: '"Underwood"',
    length: '4:13'
  },
  {
    No: 14,
    title: '"Burning"',
    length: '5:00'
  },
  ];


  function SongsList(props) {
    return (
      <div className='Songs'>
        <h4>Songs:</h4>
        <ul>
          {props.songs.map(song =>
            <li key={song.No}>
              {song.No}. {song.title} - {song.length}
            </li>
          )}
        </ul>
      </div>
    );

  }
export default App;
